import React, { Component } from 'react';
import ourStory from '../src/img/Our story@2x.png';
import ourStoryBook from '../src/img/ourStoryBook.png';

export default class Ourstory extends Component {
  render() {
    return (
      <div className="ourStory">
        <div className="ourStory__centered">
          <img src={ourStory} alt="Logo name says rocket apparel" className="ourStory__head"/>
        </div>
        <div className="ourStory__centered">
          <img src={ourStoryBook} alt="Logo" className="ourStory__icon"/>
        </div>
        <p>
        The Rocket is launching a non-profit product movement. We are interested in increasing societal awareness of the ecological issues facing our planet. In the past few months, we have been studied the ecological impacts of increased global demand for cashmere. It turns out that 70% of Mongolian grasslands are damaged to a degree. If you would like, you can read some of the research here or contact us to learn more. Our vision is to create a series of products that expose ecological impacts of consumption and climate change. All of the profit generated from these products will go directly to efforts that help prevent those ecological impacts. With the Rocket fleece, we would like to generate funds donate to and collaborate with Wildlife Conservation Society Mongolia to help them breed better goats and educate herders about overgrazing.
        </p>
      </div>
    )
  }
}
